function App() {
var href = "./public/inicio.html";

  return (
    <body >
      <main >

            <form class="efeito">
              <img src={logo}></img>
              <input type="text" placeholder='Usuario' />
              <input type="password" placeholder='Senha' />
             <button>Logar</button>


            </form>
            <span>Não possui uma conta?<a> Criar</a></span>
            <span>Essa tela é somente para intuito de aprendizado não contem nenhum tipo de monetização não possui nenhum vinculo com a AME<br/><a src={ame}>link oficial AME</a> </span>


      </main>
      <footer>

      </footer>
    </body>
  );
}

export default App;
